import React from 'react';
import s from './Discount.module.css'
const Discount = ()=>{
    return(
<div className={s.discount}>
    <div className={s.discount5}>
<p className={s.title5}>Как получить скидку 5%</p>
<span className={s.spanItem}></span><br/>
<span className={s.craftframeSpan}></span><br/>
<span className={s.spanItem}></span>
    </div>
    <div className={s.discount10}>
    <p className={s.title10}></p>
<span className={s.spanItem}></span><br/>
<span className={s.craftframeSpan}></span><br/>
<span className={s.spanItem}></span>
    </div>
    <div className={s.footer}>
        <span className={s.spanItem} ></span><span id={s.email}></span><br/>
        <span className={s.spanItem}></span>
        <span className={s.spanItem}></span><img></img>
    </div>
</div>
    );
};

export default Discount;
